import "./WhatUserSays.css";

export const WhatUserSays = () => {
    return (
        <div id="WhatUserSays">
            <div id="WhatUserSaysTitle">What our users have to say</div>
            <div id="WhatUserSaysTitle2">Beautiful application with elegant UI Design. I found this app very useful. Placed Order for a few medicines and recieved in just two days. Same medicine costs me +100 from local Shop. Recommended application. :-).</div>

            <div className="WhatUserSaysApplication">
                <div><img src="https://www.practostatic.com/ecommerce-assets/static/media/home/common/testimony2.9e5212dc.jpg" alt="" /></div>
                <div id="WhatUserSaysApplicationInfo">
                    <div id="WhatUserSaysApplicationName">Ayush Verma</div>
                    <div id="WhatUserSaysApplicationTime">Oct 5, 2018 at 11:33 AM</div>
                </div>
            </div>
        </div>
    )
}
